import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state={
      firstname: '',
      lastname: ''
    }

  }

  render() {
    const { firstname, lastname } = this.state;
    return (
      <div className="App">
        <form>
          <input value = {firstname}/>
          <input value = {lastname}/>
        </form>
      </div>
    );
  }
}

export default App;
